def add(x: int, y: int):
    """Add two numbers x and y
    >>> add(2, 3)
    5
    >>> add(5, 7)
    12
    """

    if x == 0:
        return y
    if y == 0:
        return x

    if x < y:
        x, y = y, x

    for i in range(y - x):
        x += i

    return x
